import React from 'react'

function Boat(props){
    function handleClick(e){
        e.stopPropagation()
        props.callback(props.data)

    }
    props.selected ? console.log(props.data.name): console.log("Not this boat")
    return(
        <div onClick={handleClick} className={props.selected ? "boat selected" : "boat"}>
            <p>{props.data.name}</p>
            <p>{props.data.class}</p>
        </div>
    )
}

export default Boat
